import React from 'react';
import {Link} from '@reach/router';



const NavBar = (props) => {



    return(
        <div className="nav-bar-flex">
            <span className="span-style">
                <Link className="link-style" to="/projects/boxgenerator"><h2>Color Box</h2></Link>
            </span>
            <span className="span-style">
                <Link className="link-style" to="/projects/tabs"><h2>Tabs</h2></Link>
            </span>
            <span className="span-style">
                <Link className="link-style" to="projects/todolist"><h2>Todo List</h2></Link>
            </span>
        </div>
    )
}

export default NavBar;
